                            "pages.emailHosting.imageSections.collaboration.heading": "Take Business Collaboration to the Next Level",
                            "pages.emailHosting.imageSections.collaboration.description": "Schedule your meetings, start video conferencing, and manage your contacts using Titan’s built-in calendar and contacts apps.",
                            "pages.emailHosting.imageSections.email.description": "With Titan mail server, you can stay connected whenever and wherever you work. Titan works on all major browsers and on-the-go with native email clients for Android and iOS.",
                            "pages.emailHosting.imageSections.security.heading": "Don’t Worry About Security",
                            "pages.emailHosting.imageSections.security.description": "Titan’s advanced security measures, implemented on its own professional servers, protect your work emails from spam and virus, malware, ransomware, phishing attacks, and other cyber threats.",
