                            "faq.answer.shared-hosting.how-does-website-hosting-work": "<p>Your website is a collection of files and (in most cases) databases shown to your visitors as they browse your site. Hostinger, like most web hosts, allocates storage space for your website’s files and databases on a server.</p><p>When you sign up for Hostinger's hosting plans, you'll receive login details to access your hosting account's admin panel – the hPanel. In hPanel, you can manage everything related to your website, from hosting to domains, databases, files, etc.</p>",
