                            "pages.wordpressHosting.introductionListSection.optimizedTechnology.heading": "Fast Hosting for WordPress",
                            "pages.wordpressHosting.websiteMigration.buttonText": "Migrate Your Site Today",
                            "pages.wordpressHosting.tutorials.description": "From site optimization to hosting account management, our tutorials will show you how to make the most of WordPress.",
                            "faq.answer.wordpress-hosting-a2": "<p>In the early days, WordPress used to be known as a blogging platform. Over the years, millions of WordPress users have created various types of websites, such as online stores, portfolios, resumes, forums, publications, and membership sites.</p> <p>What makes WordPress so versatile are the plugins, which add extra features on top of the core software. For instance, the WooCommerce plugin offers essential tools for building an eCommerce site, like storefront customization, inventory management, and payment processing.</p>",
                            "faq.answer.wordpress-hosting-a5": "<p>What differentiates standard web hosting from WordPress hosting is that the latter is usually optimized around WordPress and includes additional features.</p><p>With a standard web hosting service, you can install various CMSs – including WordPress. As such, it’s possible to host multiple sites using different website-building platforms.</p><p>That said, standard hosting doesn’t include the specific advantages of WordPress hosting, such as speed optimization, security features, and customer support provided by WordPress experts.</p>",
                            "faq.answer.wordpress-hosting-a6": '<p>Depending on the size of your online project, our WordPress plans cost from {premiumPrice}-{proPrice}/month:</p> <ul>\n<li><b>Premium WordPress Plan – {premiumPrice}/month</b></li>\n<li><b>Business WordPress Plan – {businessPrice}/month</b></li>\n<li><b>Cloud Startup Plan – {proPrice}/month</b></li></ul>\n<p>If you want to opt for the self-hosted WordPress environment, you are at the right place. Offering a custom-built server stack and a custom control panel, hPanel allows us to optimize and provide a significantly lower price for our WordPress services! With WordPress hosting plans, you get a <a href="{link}">free domain name</a> for the first year without paying, including a .com extension, for an even easier start online.</p>\n<p>All our WP hosting plans include a 30-day money-back guarantee so that you can explore your new web hosting account without risk.</p>',
                            "faq.answer.wordpress-hosting-a7": "<p>To migrate a website for free, you just need to purchase one of our plans. Then:</p>\n<ol> <li>Go to the hPanel and navigate to the <b>Migrate Website</b> menu.</li>\n<li>Add a migration request and select <b>WordPress</b>. Fill in the required fields.</li>\n<li>Click <b>Check connection</b> to see if the information is correct.</li>\n<li>Finally, press the <b>Add request</b> button, and we will transfer the website to your new hosting account within 24 hours.</li> </ol>",
                            "faq.answer.wordpress-hosting-a8": "<p>Building a WordPress website takes a few simple steps. Here’s how:</p><ol>\n<li>Get a WordPress hosting plan and register your domain name.</li>\n<li>Use the 1-click installer to set up WordPress on your account.</li>\n<li>Install your desired WordPress theme and set up some plugins.</li>\n<li>Create and publish your website pages.</li></ol>\n<p>Congratulations, your WordPress website is now live!</p>",
