                            "head.sslCertificate.description": "Free SSL secures your website. Get SSL/TLS certificates activated instantly at zero cost to protect your website and customers.",
                            "pages.sslCertificate.singleColoredSection.title": "The Difference Between Paid and Free SSL Certificates",
