                            "faq.question.ssl-certificates-q1": "What Is an SSL Certificate?",
                            "faq.question.ssl-certificates-q4": "What Are the Different Types of SSL Certificates?",
                            "faq.answer.ssl-certificates-a7": "<p>Generally, a new SSL certificate will become active in just a few minutes – you just need to install it on the website.</p><p>At Hostinger, we offer web hosting with free SSL certificates, so they will be installed automatically on any website you create. If you have further questions about how to get SSL for free, please contact our 24/7 Customer Success team.</p>",
                            "faq.answer.ssl-certificates-a8": "<p>To renew an SSL/TLS certificate manually, you have to generate a new SSL certificate signing request (CSR), fill out the form, and install the latest version.</p><p>At Hostinger, you don’t need to do it manually, as we offer an automatic renewal feature for our free SSL certificates.</p>",
